import Breadcrumb from 'react-bootstrap/Breadcrumb'

const LanguageSelect = ({langauge, changeLangauge}) => {
    return ( 
        <Breadcrumb>
            <Breadcrumb.Item variant='primary' onClick={console.log('check')}>English</Breadcrumb.Item>
            <Breadcrumb.Item onClick={console.log('check2')}>Русский</Breadcrumb.Item>
      </Breadcrumb>
     );
}
 
export default LanguageSelect;
